import React from "react";

function Nav() {
  return (
    <nav>
      <div className="nav flex-column">
      <div class="dropdown-menu">
  <h6 class="dropdown-header">Dropdown header</h6>
  <a class="dropdown-item" href="#">Action</a>
  <a class="dropdown-item" href="#">Another action</a>
</div>
      </div>
    </nav>
  );
}

export default Nav;
